import React from 'react';
import SideNav, { NavItem, NavIcon, NavText } from '@trendmicro/react-sidenav';
import { withRouter, Link } from 'react-router-dom'
import '@trendmicro/react-sidenav/dist/react-sidenav.css';
import styled from 'styled-components';

const headerStyles = {
    padding: 5,
    background: '#C71585',
  };


const a = styled(NavItem)`
    ${({ active }) => active && `
       color: #fff;
  `}
`


function Sidebar() {
    const data = [
        { key: '21' ,name: 'home', icon: 'home', route: '/home', defaultName: 'Homeee' },
        { key: '31' ,name: 'user', icon: 'user', route: '/user', defaultName: 'Usuário' },
        { key: '41' ,name: 'category', icon: 'tag', route: '/category', defaultName: 'Categoria' },
        { key: '51' ,name: 'products', icon: 'tags', route: '/products', defaultName: 'Produtos' },
        { key: '61' ,name: 'orders', icon: 'list-alt', route: '/orders', defaultName: 'Pedidos' },
        { key: '71' ,name: 'logout', icon: 'power-off', route: '/logout', defaultName: 'Logout' },
    ]
    return(
    <>
      <SideNav style={headerStyles} >
        <SideNav.Toggle />
        <SideNav.Nav defaultSelected="">
        {  
            data.map((el, index) => (

                    <NavItem key={el.key} eventKey={el.name} >
                            <NavIcon>
                                <Link to={el.route} > 
                                    <i className={`fa fa-fw fa-${el.icon}`} style={{ fontSize: '1.75em' }} />
                                </Link>
                            </NavIcon>
                            <NavText> 
                                 <Link to={el.route} >  
                                    {el.defaultName}
                                </Link>
                            </NavText>
                    </NavItem>

            ))
        }
        </SideNav.Nav>
    </SideNav>      
    </>
    )
}

export default withRouter(Sidebar);
